INSERT INTO `activity` VALUES (10, '校园春季运动会', '<p><span style=\"color: rgb(36, 41, 47); font-size: 14px;\">有足球比赛、篮球比赛以及田径运动比赛等等。不仅能锻炼身体，更能提高团队协作精神。</span></p>', '2023-05-25 00:00', '2023-05-29 00:00', 1, '体育场', 0.00, 'http://localhost:9090/file/download/f7a24c00cd154f86aac7cb350de57850.webp', 'http://localhost:9090/file/download/50430921556d40acb9f4ba3087ca0e51.docx', '未开始', 100, 97, 0, '2023-04-14 19:50:35', '2023-04-14 19:50:35');
INSERT INTO `activity` VALUES (11, '文艺演出', '<p><span style=\"color: rgb(0, 0, 0); font-size: 14px;\">学生们每学期都能观看到不同类型的文艺表演，如音乐会、独唱、朗诵等。</span></p>', '2023-04-15 00:00', '2023-04-16 00:00', 1, '礼堂', 20.00, NULL, NULL, '已结束', 200, 198, 0, '2023-04-14 19:53:27', '2023-04-14 19:53:27');
