INSERT INTO `dynamic` VALUES (52, 0, '快毕业了，四年好快呀', '<p>转眼已经大四下了，六月初答辩完就毕业了，心里充满了不舍。</p><p>大学四年三年疫情，我们19级是很不幸的一届，没有好好体验大学生活，匆匆结束了大学阶段。</p><h2>学弟学妹们要珍惜大学时光呀，做一些有意义的事情，不要虚度光阴！</h2>', 20, '2023-04-15 14:18:47', 4, '[\"校园\"]', '[]');
