INSERT INTO `dynamic` VALUES (54, 0, '五一劳动节快乐', '<p><a href=\"https://baike.baidu.com/item/%E5%9B%BD%E9%99%85%E5%8A%B3%E5%8A%A8%E8%8A%82/519420?fromModule=lemma_inlink\" target=\"_blank\">国际劳动节</a>又称“五一国际劳动节”“<a href=\"https://baike.baidu.com/item/%E5%9B%BD%E9%99%85%E7%A4%BA%E5%A8%81%E6%B8%B8%E8%A1%8C%E6%97%A5/842618?fromModule=lemma_inlink\" target=\"_blank\">国际示威游行日</a>”（英语：International Workers\' Day，May Day），是世界上80多个国家的全国性节日。定在每年的五月一日。它是全世界劳动人民共同拥有的<a href=\"https://baike.baidu.com/item/%E8%8A%82%E6%97%A5/723?fromModule=lemma_inlink\" target=\"_blank\">节日</a>。</p><p>1889年7月，由<a href=\"https://baike.baidu.com/item/%E6%81%A9%E6%A0%BC%E6%96%AF/159912?fromModule=lemma_inlink\" target=\"_blank\">恩格斯</a>领导的<a href=\"https://baike.baidu.com/item/%E7%AC%AC%E4%BA%8C%E5%9B%BD%E9%99%85/2209097?fromModule=lemma_inlink\" target=\"_blank\">第二国际</a>在<a href=\"https://baike.baidu.com/item/%E5%B7%B4%E9%BB%8E/858?fromModule=lemma_inlink\" target=\"_blank\">巴黎</a>举行代表大会。会议通过决议，规定1890年5月1日国际劳动者举行游行，并决定把5月1日这一天定为国际劳动节。<a href=\"https://baike.baidu.com/item/%E4%B8%AD%E5%A4%AE%E4%BA%BA%E6%B0%91%E6%94%BF%E5%BA%9C?fromModule=lemma_inlink\" target=\"_blank\">中央人民政府</a>政务院于1949年12月作出决定，将5月1日确定为劳动节。1989年后，国务院基本上每5年表彰一次<a href=\"https://baike.baidu.com/item/%E5%85%A8%E5%9B%BD%E5%8A%B3%E5%8A%A8%E6%A8%A1%E8%8C%83/10435145?fromModule=lemma_inlink\" target=\"_blank\">全国劳动模范</a>和<a href=\"https://baike.baidu.com/item/%E5%85%88%E8%BF%9B%E5%B7%A5%E4%BD%9C%E8%80%85?fromModule=lemma_inlink\" target=\"_blank\">先进工作者</a>，每次表彰3000人左右。</p>', 23, '2023-05-02 21:22:20', 3, '[\"节日\", \"科普\", \"知识\"]', '[]');
