INSERT INTO `information` VALUES (22, '校园交友平台正式上线', '<h1>欢迎各位使用！</h1><p>我们真诚欢迎您提出宝贵的意见！</p>', NULL, '2023-03-30 21:51:23', 11);
INSERT INTO `information` VALUES (26, '关于组织义卖活动的通知', '<p>校青协团队将于下周六在学校举行义卖活动，募集善款支持当地贫困儿童教育项目。欢迎同学们前往支持。</p>', 'http://localhost:9090/file/download/972a251b2b634fdc99346af0f6c05d0a.pdf', '2023-04-14 22:11:43', 2);
INSERT INTO `information` VALUES (27, '关于组织文艺晚会的通知', '<p>本周五晚上7点，学校将举行一场文艺晚会，邀请校内外音乐、舞蹈、朗诵等爱好者以及表演艺术社团表演。欢迎广大师生踊跃参加！</p>', 'http://localhost:9090/file/download/1705e1e5bb2948cca265b462053678a0.txt', '2023-04-14 22:12:12', 0);
INSERT INTO `information` VALUES (28, '关于提醒学生注意财产安全的通知', '<p>近期校园内发生多起失窃事件，请广大师生注意个人物品安全，勿轻信陌生人。</p>', NULL, '2023-04-14 22:12:36', 0);
INSERT INTO `information` VALUES (29, '关于净化校园环境的通知', '<p>为了维护优良的校园环境，校方决定对随意涂鸦、乱扔垃圾的行为进行惩罚。希望广大师生自觉遵守相关规定，共同营造文明校园。</p>', 'http://localhost:9090/file/download/50430921556d40acb9f4ba3087ca0e51.docx', '2023-04-14 22:13:10', 0);
INSERT INTO `information` VALUES (30, '关于举办交通安全知识比赛的通知', '<p>为提高学生交通安全意识，学校交通安全协会将于本周末在校内举办交通安全知识比赛，欢迎同学们参加。</p>', 'http://localhost:9090/file/download/50430921556d40acb9f4ba3087ca0e51.docx', '2023-04-14 22:13:37', 0);
INSERT INTO `information` VALUES (31, '关于规范学生网络使用行为的宣传活动', '<p>近九成学生智能手机使用时间超过三小时，为了规范学生网络使用行为，学校将于下周一至五开展“防沉迷周”主题宣传活动。</p>', 'http://localhost:9090/file/download/1705e1e5bb2948cca265b462053678a0.txt', '2023-04-14 22:14:17', 2);
INSERT INTO `information` VALUES (32, '关于组织“海大杯”足球比赛的通知', '<h1>学校计划于2023年4月开展“海大杯”足球比赛，希望大家踊跃参与！</h1>', 'http://localhost:9090/file/download/972a251b2b634fdc99346af0f6c05d0a.pdf', '2023-04-15 13:51:07', 2);
INSERT INTO `information` VALUES (33, '关于组织“红色足迹”定向运动比赛的通知', '<p>关于组织“红色足迹”定向运动比赛的通知</p>', 'http://localhost:9090/file/download/50430921556d40acb9f4ba3087ca0e51.docx', '2023-04-15 13:51:31', 2);
