INSERT INTO `notice` VALUES (1, '校园交友平台-后台管理系统', '<h1>后台管理系统仅限管理员角色使用，普通用户只能访问前台界面。<br>管理员可以分配更多的角色，分配不同的权限、</h1>', '管理员', 1, '2023-04-04 10:35:19');
INSERT INTO `notice` VALUES (2, '公告管理', '<p>分为前台公告管理和后台公告管理，前台公告管理可以上传附件供用户下载。</p><ul><li>前台管理</li><li>后台管理</li></ul>', '管理员', 1, '2023-04-04 16:10:03');
INSERT INTO `notice` VALUES (3, '动态管理', '<p style=\"text-align: left;\">动态管理包括动态管理、点赞管理、收藏管理、评论管理、话题管理模块。</p><ul><li style=\"text-align: left;\">动态管理</li><li style=\"text-align: left;\">点赞管理</li><li style=\"text-align: left;\">收藏管理</li><li style=\"text-align: left;\">评论管理</li><li style=\"text-align: left;\">话题管理</li></ul>', '管理员', 1, '2023-04-15 13:53:32');
INSERT INTO `notice` VALUES (4, '活动管理', '<p>活动管理包括活动管理和预约管理模块。</p><ul><li>活动管理</li><li>预约管理</li></ul>', '管理员', 1, '2023-04-15 13:56:11');
INSERT INTO `notice` VALUES (5, '聊天管理', '<p>管理聊天信息</p>', '管理员', 1, '2023-04-15 13:56:32');
INSERT INTO `notice` VALUES (6, '消息通知管理', '<p>管理消息通知信息</p>', '管理员', 1, '2023-04-15 13:56:46');
INSERT INTO `notice` VALUES (7, '关注管理', '<p>管理关注信息</p>', '管理员', 1, '2023-04-15 13:57:00');
INSERT INTO `notice` VALUES (8, '系统管理', '<p>系统管理包括用户、角色、权限、数据字典、文件、日志管理模块。</p><ul><li>用户管理</li><li>角色管理</li><li>权限管理</li><li>数据字典管理</li><li>文件管理</li><li>日志管理</li></ul>', '管理员', 1, '2023-04-15 13:57:57');
