http://localhost:9090/file/download/fb90ee0fa77f4f709b3314681d15ea2a.webp\",\"逻辑删除 0存在  id删除\":0,\"createTime\":1678761111000,\"updateTime\":1678761111000,\"角色\":\"USER\",\"积分\":9,\"是否禁用\":false,\"是否自动审核预约\":false,\"hasFollow\":false,\"hasBeFollow\":false},\"hasPraise\":false,\"hasCollect\":false,\"praiseCount\":0,\"collectCount\":0,\"commentCount\":0,\"topics\":[\"节日\",\"科普\",\"知识\"],\"imgs\":[]}', '{\"code\":\"200\",\"msg\":\"操作成功\"}', 'http://localhost:9090/dynamic', 16, '39.152.151.239', NULL, 'linchen', '2023-05-02 21:22:36', 0);
